import styled from "styled-components";


const Container = styled.div`
    /* Navbar_sc */

    position: absolute;
    width: 1008px;
    height: 64px;
    left: 272px;
    top: 64px;

    /* Color/B&W/White */
    background: #FFFFFF;
`;

const Periodo = styled.span`
    /* Junho 2022 */

    position: absolute;
    width: 86px;
    height: 19px;
    left: 43px;
    top: 24px;

    font-family: 'Roboto';
    font-style: normal;
    font-weight: 600;
    font-size: 16px;
    line-height: 19px;

    /* identical to box height */

    /* Color/Primary/Branding */
    color: #5B1F53;
`;

const VetorContainer = styled.svg`
    position: absolute;
    width: 24px;
    height: 24px;
    left: 137px;
    top: 46px;

    transform: matrix(1, 0, 0, -1, 0, 0);
`;

const Vetor = styled.svg`
    /* Vector */

    position: absolute;
    left: 26.72%;
    right: 26.72%;
    top: 63.72%;
    bottom: 8.84%;

    /* Color/Primary/Branding */
    background: #5B1F53;
    transform: matrix(1, 0, 0, -1, 0, 0);

`;



export {Container, Periodo, VetorContainer,Vetor};
